import React, { useState } from "react";

import Nav from "../../components/browse/Nav";
import SearchResult from "../../components/search/SearchResult";
import "./Search.css";

const Search = () => {
  const [query, setQuery] = useState("");
  const [keywordInput, setKeywordInput] = useState("");
  const [genreInput, setGenreInput] = useState("");
  const [languageInput, setLanguageInput] = useState("");
  const [mediaTypeInput, setMediaTypeInput] = useState("");
  const [yearInput, setYearInput] = useState("");

  const handleSearch = () => {
    setQuery({
      keyword: keywordInput,
      genre: genreInput,
      language: languageInput,
      mediaType: mediaTypeInput,
      year: yearInput,
    });
  };

  const resetSearch = () => {
    setQuery("");
    setKeywordInput("");
    setGenreInput("");
    setLanguageInput("");
    setMediaTypeInput("");
    setYearInput("");
  };
  console.log(query);

  return (
    <div className="app">
      <Nav />
      <div className="s009">
        <form>
          <div className="inner-form">
            <div className="basic-search">
              <div className="input-field">
                <input
                  type="text"
                  placeholder="Type Keywords"
                  onChange={(e) => setKeywordInput(e.target.value)}
                  value={keywordInput}
                />
                <div className="icon-wrap">
                  <svg
                    className="svg-inline--fa fa-search fa-w-16"
                    fill="#ccc"
                    aria-hidden="true"
                    data-prefix="fas"
                    data-icon="search"
                    role="img"
                    xmlns="http://www.w3.org/2000/svg"
                    viewBox="0 0 512 512"
                  >
                    <path d="M505 442.7L405.3 343c-4.5-4.5-10.6-7-17-7H372c27.6-35.3 44-79.7 44-128C416 93.1 322.9 0 208 0S0 93.1 0 208s93.1 208 208 208c48.3 0 92.7-16.4 128-44v16.3c0 6.4 2.5 12.5 7 17l99.7 99.7c9.4 9.4 24.6 9.4 33.9 0l28.3-28.3c9.4-9.4 9.4-24.6.1-34zM208 336c-70.7 0-128-57.2-128-128 0-70.7 57.2-128 128-128 70.7 0 128 57.2 128 128 0 70.7-57.2 128-128 128z"></path>
                  </svg>
                </div>
              </div>
            </div>
            <div className="advance-search">
              <div className="row third">
                <div className="input-field">
                  <div>
                    <div className="other-input">
                      <label htmlFor="genre" className="search-label">
                        Genre
                      </label>
                      <input
                        type="text"
                        name="genre"
                        placeholder="Genre..."
                        onChange={(e) => setGenreInput(e.target.value)}
                        value={genreInput}
                      />
                    </div>
                    <div className="other-input">
                      <label htmlFor="language" className="search-label">
                        Language
                      </label>
                      <input
                        type="text"
                        name="language"
                        placeholder="Type Language"
                        onChange={(e) => setLanguageInput(e.target.value)}
                        value={languageInput}
                      />
                    </div>
                  </div>
                  <div>
                    <div className="other-input">
                      <label htmlFor="type-media" className="search-label">
                        Media
                      </label>
                      <input
                        type="text"
                        name="type-media"
                        placeholder="Type Media"
                        onChange={(e) => setMediaTypeInput(e.target.value)}
                        value={mediaTypeInput}
                      />
                    </div>
                    <div className="other-input">
                      <label htmlFor="year" className="search-label">
                        Year
                      </label>
                      <input
                        type="number"
                        name="year"
                        placeholder="Type Year"
                        onChange={(e) => setYearInput(e.target.value)}
                        value={yearInput}
                      />
                    </div>
                  </div>
                  {/* <div className="result-count"></div> */}
                </div>
              </div>
            </div>
            <div className="group-btn">
              <button
                className="btn-delete"
                onClick={resetSearch}
                type="button"
              >
                RESET
              </button>
              <button
                className="btn-search"
                type="button"
                onClick={() => handleSearch()}
              >
                SEARCH
              </button>
            </div>
          </div>
        </form>
      </div>
      <SearchResult query={query} />
    </div>
  );
};

export default Search;
